import React from 'react';

const Cart = () => {
    return(
        <>
            <header>
                <div className="continue-shopping">
                    <img src="./images/arrow.png"  alt="arrow" className="arrow-icon"/>
                    <h3>Continue Shopping</h3>
                </div>
            </header>
        </>
    )
}

export default Cart;
